      VALUES(V_TILE_ID,V_DASHBOARD_ID,V_CREATION_DATE,V_LAST_MODIFICATION_DATE,V_LAST_MODIFIED_BY,V_OWNER,V_TITLE,V_HEIGHT,V_WIDTH,V_IS_MAXIMIZED,V_POSITION,V_TENANT_ID,
             V_WIDGET_UNIQUE_ID,V_WIDGET_NAME,V_WIDGET_DESCRIPTION,V_WIDGET_GROUP_NAME,V_WIDGET_ICON,V_WIDGET_HISTOGRAM,V_WIDGET_OWNER,V_WIDGET_CREATION_TIME,V_WIDGET_SOURCE,V_WIDGET_KOC_NAME,
             V_WIDGET_VIEWMODE,V_WIDGET_TEMPLATE,V_PROVIDER_NAME,V_PROVIDER_VERSION,V_PROVIDER_ASSET_ROOT,V_TILE_ROW,V_TILE_COLUMN,V_TILE_TYPE,V_TILE_SUPPORT_TIMECONTROL,V_TILE_LINKED_DASHBOARD);     
     --2. remove old dashboards from ANY (OOB+user created) dashboard set and replace removed one with new ones.
          --   old: 25:Timeseries <---> new: 41:Timeseries - Line Basic, 42:Timeseries - Line Advanced, 43:Timeseries - Area, 46:Trend and Forecasting
          --   old: 26:Categorical<---> new: 44:Categorical - Basic, 45:Categorical - Advanced

     V_DASHBOARD_ID_OLD:=25;
     V_DASHBOARD_ID_NEW:=41;
     UPDATE EMS_DASHBOARD_SET SET SUB_DASHBOARD_ID=V_DASHBOARD_ID_NEW WHERE SUB_DASHBOARD_ID=V_DASHBOARD_ID_OLD AND TENANT_ID=V_TENANT_ID 
     RETURNING DASHBOARD_SET_ID,TENANT_ID,SUB_DASHBOARD_ID,POSITION,CREATION_DATE,LAST_MODIFICATION_DATE,DELETED BULK COLLECT INTO V_SET_TABLE;    
     FOR V_I IN V_SET_TABLE.FIRST .. V_SET_TABLE.LAST
     LOOP       
        V_DASHBOARD_ID_NEW:=42;
        UPDATE EMS_DASHBOARD_SET SET POSITION = POSITION+3 WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_SET_ID=V_SET_TABLE(V_I).DASHBOARD_SET_ID AND POSITION>V_SET_TABLE(V_I).POSITION;
        
        INSERT INTO EMS_DASHBOARD_SET(DASHBOARD_SET_ID,TENANT_ID,SUB_DASHBOARD_ID,POSITION,CREATION_DATE,LAST_MODIFICATION_DATE,DELETED) 
        VALUES(V_SET_TABLE(V_I).DASHBOARD_SET_ID,V_TENANT_ID,V_DASHBOARD_ID_NEW,V_SET_TABLE(V_I).POSITION+1,V_CREATION_DATE,V_LAST_MODIFICATION_DATE,V_SET_TABLE(V_I).DELETED);
        V_DASHBOARD_ID_NEW:=43;
        INSERT INTO EMS_DASHBOARD_SET(DASHBOARD_SET_ID,TENANT_ID,SUB_DASHBOARD_ID,POSITION,CREATION_DATE,LAST_MODIFICATION_DATE,DELETED) 
        VALUES(V_SET_TABLE(V_I).DASHBOARD_SET_ID,V_TENANT_ID,V_DASHBOARD_ID_NEW,V_SET_TABLE(V_I).POSITION+2,V_CREATION_DATE,V_LAST_MODIFICATION_DATE,V_SET_TABLE(V_I).DELETED);
        V_DASHBOARD_ID_NEW:=46;
        INSERT INTO EMS_DASHBOARD_SET(DASHBOARD_SET_ID,TENANT_ID,SUB_DASHBOARD_ID,POSITION,CREATION_DATE,LAST_MODIFICATION_DATE,DELETED) 
        VALUES(V_SET_TABLE(V_I).DASHBOARD_SET_ID,V_TENANT_ID,V_DASHBOARD_ID_NEW,V_SET_TABLE(V_I).POSITION+3,V_CREATION_DATE,V_LAST_MODIFICATION_DATE,V_SET_TABLE(V_I).DELETED);
        DBMS_OUTPUT.put_line('Dashboard set with id: ' || V_SET_TABLE(V_I).DASHBOARD_SET_ID||' is updated, old dashboard: '||V_DASHBOARD_ID_OLD||', new dashboard: '||V_DASHBOARD_ID_NEW||' for tenant: '||V_TENANT_ID);
     END LOOP;

     V_DASHBOARD_ID_OLD:=26;
     V_DASHBOARD_ID_NEW:=44;
     UPDATE EMS_DASHBOARD_SET SET SUB_DASHBOARD_ID=V_DASHBOARD_ID_NEW WHERE  SUB_DASHBOARD_ID=V_DASHBOARD_ID_OLD AND TENANT_ID=V_TENANT_ID 
     RETURNING DASHBOARD_SET_ID,TENANT_ID,SUB_DASHBOARD_ID,POSITION,CREATION_DATE,LAST_MODIFICATION_DATE,DELETED BULK COLLECT INTO V_SET_TABLE;
     FOR V_I IN V_SET_TABLE.FIRST .. V_SET_TABLE.LAST
     LOOP       
        V_DASHBOARD_ID_NEW:=45;
        UPDATE EMS_DASHBOARD_SET SET POSITION = POSITION+1 WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_SET_ID=V_SET_TABLE(V_I).DASHBOARD_SET_ID AND POSITION>V_SET_TABLE(V_I).POSITION;
        INSERT INTO EMS_DASHBOARD_SET(DASHBOARD_SET_ID,TENANT_ID,SUB_DASHBOARD_ID,POSITION,CREATION_DATE,LAST_MODIFICATION_DATE,DELETED) 
        VALUES(V_SET_TABLE(V_I).DASHBOARD_SET_ID,V_TENANT_ID,V_DASHBOARD_ID_NEW,V_SET_TABLE(V_I).POSITION+1,V_CREATION_DATE,V_LAST_MODIFICATION_DATE,V_SET_TABLE(V_I).DELETED);
        DBMS_OUTPUT.put_line('Dashboard set with id: ' || V_SET_TABLE(V_I).DASHBOARD_SET_ID||' is updated, old dashboard: '||V_DASHBOARD_ID_OLD||', new dashboard: '||V_DASHBOARD_ID_NEW||' for tenant: '||V_TENANT_ID);
     END LOOP;
     
     V_DASHBOARD_ID:=24;--UI Gallery id
     V_DASHBOARD_ID_NEW:=46;--forcast
     V_POSITION:=5;
     UPDATE EMS_DASHBOARD_SET SET POSITION = V_POSITION WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_SET_ID=V_DASHBOARD_ID AND SUB_DASHBOARD_ID=V_DASHBOARD_ID_NEW;

     V_DASHBOARD_ID_NEW:=44;--categorical basic
     V_POSITION:=3;
     UPDATE EMS_DASHBOARD_SET SET POSITION = V_POSITION WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_SET_ID=V_DASHBOARD_ID AND SUB_DASHBOARD_ID=V_DASHBOARD_ID_NEW;
     
     V_DASHBOARD_ID_NEW:=45;--categorical adv
     V_POSITION:=4;
     UPDATE EMS_DASHBOARD_SET SET POSITION = V_POSITION WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_SET_ID=V_DASHBOARD_ID AND SUB_DASHBOARD_ID=V_DASHBOARD_ID_NEW;
     DBMS_OUTPUT.put_line('Order of individual Dashboard set inside UI Gallery is adjusted successfully for '||V_TENANT_ID); 
     
     --3. old data clean
     --3.1 update dashboard:24 in EMS_DASHBOARD_USER_OPTIONS table:EXTENDED_OPTIONS: e.g. {"selectedTab":"27"}
     V_STR_OLD:='"selectedTab":"25"';
     V_STR_NEW:='"selectedTab":"41"';
     UPDATE EMS_DASHBOARD_USER_OPTIONS SET EXTENDED_OPTIONS=REPLACE(EXTENDED_OPTIONS,V_STR_OLD,V_STR_NEW) 
     WHERE TENANT_ID=V_TENANT_ID AND EXTENDED_OPTIONS like '%'||V_STR_OLD||'%';
     DBMS_OUTPUT.PUT_LINE('Selected tab of old DASHBOARD:'||V_STR_OLD||' is updated to '||V_STR_NEW||' by '||SQL%ROWCOUNT||' successfully for tenant:'||V_TENANT_ID);
      
     V_STR_OLD:='"selectedTab":"26"';
     V_STR_NEW:='"selectedTab":"44"';
     UPDATE EMS_DASHBOARD_USER_OPTIONS SET EXTENDED_OPTIONS=REPLACE(EXTENDED_OPTIONS,V_STR_OLD,V_STR_NEW) 
     WHERE TENANT_ID=V_TENANT_ID AND EXTENDED_OPTIONS like '%'||V_STR_OLD||'%';
     DBMS_OUTPUT.PUT_LINE('Selected tab of old DASHBOARD:'||V_STR_OLD||' is updated to '||V_STR_NEW||' by '||SQL%ROWCOUNT||' successfully for tenant:'||V_TENANT_ID);
     
     --3.2 remove any old dashboards (25,26) in EMS_DASHBOARD_USER_OPTIONS table
     V_DASHBOARD_ID_OLD:=25;
     DELETE FROM EMS_DASHBOARD_USER_OPTIONS WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_ID=V_DASHBOARD_ID_OLD;
     DBMS_OUTPUT.PUT_LINE('OOB DASHBOARD:'||V_DASHBOARD_ID_OLD||' is removed from user options:'||SQL%ROWCOUNT||' successfully for tenant:'||V_TENANT_ID);
     V_DASHBOARD_ID_OLD:=26;
     DELETE FROM EMS_DASHBOARD_USER_OPTIONS WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_ID=V_DASHBOARD_ID_OLD; 
     DBMS_OUTPUT.PUT_LINE('OOB DASHBOARD:'||V_DASHBOARD_ID_OLD||' is removed from user options:'||SQL%ROWCOUNT||' successfully for tenant:'||V_TENANT_ID);
     
     --3.3 delete old dashboard_id:25,26 in EMS_DASHBOARD_TILE/EMS_DASHBOARD_TILE_PARAMS
     V_DASHBOARD_ID_OLD:=25;
     DELETE FROM EMS_DASHBOARD_TILE_PARAMS WHERE TENANT_ID=V_TENANT_ID AND TILE_ID IN (SELECT TILE_ID FROM EMS_DASHBOARD_TILE WHERE  TENANT_ID=V_TENANT_ID AND DASHBOARD_ID=V_DASHBOARD_ID_OLD);
     DBMS_OUTPUT.PUT_LINE('OOB DASHBOARD:'||V_DASHBOARD_ID_OLD||'''s tile parameters:'||SQL%ROWCOUNT||' have been deleted successfully for tenant:'||V_TENANT_ID);
     DELETE FROM EMS_DASHBOARD_TILE WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_ID=V_DASHBOARD_ID_OLD;
     DBMS_OUTPUT.PUT_LINE('OOB DASHBOARD:'||V_DASHBOARD_ID_OLD||'''s tiles:'||SQL%ROWCOUNT||' have been deleted successfully for tenant:'||V_TENANT_ID);
     
     V_DASHBOARD_ID_OLD:=26;
     DELETE FROM EMS_DASHBOARD_TILE_PARAMS WHERE TENANT_ID=V_TENANT_ID AND TILE_ID IN (SELECT TILE_ID FROM EMS_DASHBOARD_TILE WHERE  TENANT_ID=V_TENANT_ID AND DASHBOARD_ID=V_DASHBOARD_ID_OLD);
     DBMS_OUTPUT.PUT_LINE('OOB DASHBOARD:'||V_DASHBOARD_ID_OLD||'''s tile parameters:'||SQL%ROWCOUNT||' have been deleted successfully for tenant:'||V_TENANT_ID);
     DELETE FROM EMS_DASHBOARD_TILE WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_ID=V_DASHBOARD_ID_OLD; 
     DBMS_OUTPUT.PUT_LINE('OOB DASHBOARD:'||V_DASHBOARD_ID_OLD||'''s tiles:'||SQL%ROWCOUNT||' have been deleted successfully for tenant:'||V_TENANT_ID);
    
     --4. remove old dashboards from EMS_DASHBOARD
     V_DASHBOARD_ID_OLD:=25;
     DELETE FROM EMS_DASHBOARD WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_ID=V_DASHBOARD_ID_OLD;
     DBMS_OUTPUT.PUT_LINE('OOB DASHBOARD:'||V_DASHBOARD_ID_OLD||' is deleted successfully for tenant:'||V_TENANT_ID);
     
     V_DASHBOARD_ID_OLD:=26;
     DELETE FROM EMS_DASHBOARD WHERE TENANT_ID=V_TENANT_ID AND DASHBOARD_ID=V_DASHBOARD_ID_OLD; 
     DBMS_OUTPUT.PUT_LINE('OOB DASHBOARD:'||V_DASHBOARD_ID_OLD||' is deleted successfully for tenant:'||V_TENANT_ID);
       DBMS_OUTPUT.PUT_LINE('OOB DASHBOARD UI Gallery is upgraded successfully for tenant:'||V_TENANT_ID);

     ELSE
       DBMS_OUTPUT.PUT_LINE('Upgrade is NOT required, OOB DASHBOARD UI Gallery has been upgraded to improve performance before for tenant:'||V_TENANT_ID);
     END IF;

	   IF (V_TID<>-1) THEN
        EXIT;
     END IF;
  END LOOP;
  IF TENANT_CURSOR%ISOPEN THEN
    CLOSE TENANT_CURSOR;
  END IF;
	COMMIT;
  DBMS_OUTPUT.PUT_LINE('Upgrade is done');
  EXCEPTION
    WHEN OTHERS THEN
      ROLLBACK;
      DBMS_OUTPUT.PUT_LINE('Failed to update the sql due to '||SQLERRM);
      RAISE;
  END;
